import React from "react";
import { useParams } from "react-router-dom";
import "./Blog.css";

function PostDetails() {
  const { id } = useParams();

  return (
    <div className="blog-page">
      <h1 className="blog-title">Post Details {id}</h1>
      <p className="blog-bio">Full content of the blog post will appear here.</p>
    </div>
  );
}

export default PostDetails;
